import React, { useContext } from 'react';
import {
  Button,
  Wrapper,
  Container,
  Heading,
  SubHeading,
} from './SignInOutForm.style';
import { AuthContext } from 'contexts/auth/auth.context';
import { FormattedMessage } from 'react-intl';

export default function SignOutModal() {
  const { authDispatch, authState } = useContext<any>(AuthContext);
  const toggleSignInForm = () => {
    authDispatch({
      type: 'SIGNIN',
    });
  };

  return (
    <Wrapper>
      <Container>
        <Heading>
          <FormattedMessage id='intlSuccessful' defaultMessage='Successful' />
        </Heading>

        <SubHeading>
          <FormattedMessage
            id='signUpText'
            defaultMessage='Check your email to confirm your account'
          />
        </SubHeading>

      </Container>
    </Wrapper>
  );
}
